import React from "react";
import Emojis from "./emojis";

function Single(props) {
  return (
    <div className="maincomp">
      <div className="imgcomp">
      <img src={props.img} />
      </div>

      <div className="headcomp">
        <h3>{props.name}</h3>
      </div>

      <div className="imgcomp">
        <p>{props.ds}</p>
      </div>
    </div>
  );
}
export default Single;
